import { React } from 'react'

import { Row, Col } from 'react-bootstrap'

import '../../styles/landingpage/categorybuttons.scss'

export default function CategoryButtons() {
 return (
    <Row id="categorybuttons">
      {
        ['Men', 'Women', 'Designer', 'Kids', 'Home', 'Electronics', 'Entertainment', 'Hobbies', 'Sports', 'About'].map((category, categoryindx)=> {
            return (
                <Col xs={1}
                     md={1}
                     lg={1}
                     key={categoryindx}
                     className="categorybuttons-categorybuttoncontainer">
                  <button className='categorybuttons-categorybuttoncontainer-categorybutton'>{category}</button>
                </Col>
             
            )
        })
      }
    </Row>
 )
}
